    nakresliLegendu(barva, x, y, sirka, vyska){

        var c = document.getElementById("test");
        var ctx = c.getContext("2d");
        
        ctx.beginPath();
        ctx.fillStyle = barva;
        ctx.fillRect(x, y, sirka, vyska);
        ctx.stroke();

    }


    vlozpopis(text, textX, textY){

        var c = document.getElementById("test");
        var ctx = c.getContext("2d");
       
        ctx.fillStyle = "black";
        ctx.font = "15px Arial";
        ctx.fillText(text, textX, textY);

    }

